import React from 'react';
import {SearchContext} from "../App";

const Search = () => {

const {searchPizza, setSearchPizza} = React.useContext(SearchContext)
    return (
        <div>
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="24" height="24"
               preserveAspectRatio="xMidYMid meet" style="width: 100%; height: 100%; transform: translate3d(0px, 0px, 0px);">
            <defs><clipPath id="__lottie_element_2"><rect width="24" height="24" x="0" y="0"></rect></clipPath></defs>
            <g clip-path="url(#__lottie_element_2)"><g style="display: block;" transform="matrix(1,0,0,1,0,0)"
               opacity="1"><g opacity="1" transform="matrix(1,0,0,1,18,18)">
              <path fill="rgb(0,0,0)" fill-opacity="1" d=" M4,2 C4,2 2,4 2,4 C2,4 -4,-2 -4,-2 C-4,-2 -4,-4 -4,-4 C-4,-4 -2,-4 -2,-4 C-2,-4 4,2 4,2z"></path>
                </g><g opacity="1" transform="matrix(1,0,0,1,9,9)">
              <path strokeLinecap="butt" strokeLinejoin="miter" fillOpacity="0"
                    strokeMiterlimit="10" stroke="rgb(0,0,0)" strokeOpacity="1"
                    strokeWidth="2" d=" M0,-6 C-3.313999891281128,-6 -6,-3.313999891281128
                    -6,0 C-6,3.313999891281128 -3.313999891281128,6 0,6 C3.313999891281128,6 6,3.313999891281128 6,0 C6,-3.313999891281128
                     3.313999891281128,-6 0,-6z"></path></g><g opacity="1" transform="matrix(1,0,0,1,14.25,14.25)">
              <path strokeLinecap="butt" strokeLinejoin="miter" fillOpacity="0" strokeMiterlimit="10" stroke="rgb(0,0,0)"
                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            stroke-opacity="1" stroke-width="1" d=" M-1.25,-1.25 C-1.25,-1.25 1.25,1.25 1.25,1.25"></path></g></g></g></svg>
            <input
                value={searchPizza}
                onChange={(e)=>setSearchPizza(e.target.value) }
            placeholder="Searching..."
            />
        </div>
    );
};

export default Search;
